import { Link } from "react-router-dom";
import myFrends from "../data.js/myFrends";
const Frends = () => {
  return (
    <>
      <h1>Frends</h1>
      {myFrends.map(frends => (
        <Link to={`myFrends/${frends.slug}`}ke>{frends.title}</Link>
      ))}
    </>
  );
};

export default Frends;
